function getOneElective() {
    var location = window.location.search;
    var paramPairs = location.substr(1).split('&');
    var name = paramPairs[0].split("=")[1];

    var url = 'http://localhost/project/server/previewElective.php?name=' + name;

    return performGet(url);
}

function performGet(url) {
    var xhr = new XMLHttpRequest();
    xhr.onload = function() {
        if (xhr.status == 200) {
            localStorage.removeItem("jsonResponse");
            localStorage.setItem("jsonResponse", xhr.responseText);
            var jsonResponseArr = JSON.parse(xhr.responseText);
            createTableFromJSON(jsonResponseArr);
        } else {
            //?
            //printRespose(xhr.responseText);
        }
    };

    xhr.open("GET", url, true);
    xhr.setRequestHeader("Authorization", localStorage.getItem("username"));
    xhr.send();
}

function deleteElective() {
    var jsonResponse = localStorage.getItem("jsonResponse");
    var jsonResponseArr = JSON.parse(jsonResponse);
    var electiveName = jsonResponseArr.name;
    var url = 'http://localhost/project/server/deleteOneElective.php?name=' + electiveName;

    var xhr = new XMLHttpRequest();
    xhr.onload = function() {
        if (xhr.status == 200) {
            window.location = "../html/previewAllElectives.html";
        } else {
            document.getElementById("errors").innerHTML = xhr.responseText;
        }
    };

    xhr.open("DELETE", url, true);
    xhr.setRequestHeader("Authorization", localStorage.getItem("username"));
    xhr.send();
}

function modifyElective() {
    window.location = "../html/modifyElective.html";
}

function exportElective() {
    var imgData = 'data:image/jpeg;base64,';
    var doc = new jsPDF();
    doc.setFontStyle("bolditalic");

    doc.addImage(imgData, 'JPEG', 75, 20, 50, 50);

    var jsonResponse = localStorage.getItem("jsonResponse");
    var jsonResponseArr = JSON.parse(jsonResponse);
   

    var fontSizeBig = 16;
    var fontSizeSmall = 14;
    var pageHeight = doc.internal.pageSize.height;

    doc.setFontSize(fontSizeBig);
    doc.text(50, 90, 'Faculty of mathematics and informatics');
    doc.text(50, 100, 'Sofia University St. Kliment Ohridski');

    var maxOnPage = 120;
    for (var key in jsonResponseArr) {
        if (key != "creator" && jsonResponseArr[key] !== null) {
            doc.setFontType("bold");
            if (maxOnPage + 10 >= pageHeight) {
                    doc.addPage();
                    maxOnPage = 20;
            }
            doc.text(20, maxOnPage, firstLetterUpperCase(key) + ":");
            doc.setFontType("normal");
            doc.setFontSize(fontSizeSmall);
            var splitTitle = doc.splitTextToSize(jsonResponseArr[key], 130);
            var size = splitTitle.length;
            doc.setFontSize(fontSizeBig);
            for (var i = 0; i < splitTitle.length; i++) {
                if (maxOnPage + 10 >= pageHeight) {
                    doc.addPage();
                    maxOnPage = 20;
                }
                doc.text(20, maxOnPage + 10, splitTitle[i]);
                maxOnPage += 10;
            }
            maxOnPage += 20;
        }
    }


    doc.text(140, 260, calculateCurrentDate());
    doc.text(140, 270, jsonResponseArr["lecturer"]);
    doc.text(140, 280, ".............");

    doc.save('elective-pdf.pdf');
}

function calculateCurrentDate() {
    var date = new Date('20 January, 2018');

    var dateObj = new Date();
    var month = dateObj.getUTCMonth() + 1;
    var day = dateObj.getUTCDate();
    var year = dateObj.getUTCFullYear();

    currDate = day + "/" + month + "/" + year;

    return currDate;
}

function firstLetterUpperCase(string) {
    return string.charAt(0).toUpperCase() + string.slice(1);
}

function createTableFromJSON(arr) {
    var col = [];
    col.push("Property");
    col.push("Value");

    // CREATE DYNAMIC TABLE.
    var table = document.createElement("table");
    table.classList.add("resultTable");

    var tr = table.insertRow(-1); // TABLE ROW.

    for (var i = 0; i < col.length; i++) {
        var th = document.createElement("th"); // TABLE HEADER.
        th.innerHTML = col[i];
        tr.appendChild(th);
    }

    // ADD JSON DATA TO THE TABLE AS ROWS.
    for (var key in arr) {
        if (key != "creator") {
            tr = table.insertRow(-1);

            var tabCell = tr.insertCell(-1);
            tabCell.innerHTML = key;

            var tabCell = tr.insertCell(-1);
            tabCell.innerHTML = arr[key];
        }
    }

    var divContainer = document.getElementById("tableContainer");
    divContainer.innerHTML = "";
    divContainer.appendChild(table);
}